#define N 1024
#define MAX_FREQ 0x04

extern unsigned long tick, score;
unsigned long Data, MAX_RAND;

void (*fire_func)(unsigned short, unsigned short, unsigned short);
void fire1(unsigned short, unsigned short, unsigned short);
void fire2(unsigned short, unsigned short, unsigned short);
void fire3(unsigned short, unsigned short, unsigned short);

const unsigned char start_ship1[], start_ship2[], start_ship3[],
	title_1[], title_2[];
	
unsigned char adc_str[5];

int main(void)
{
	SysCtlClockSet(SYSCTL_SYSDIV_4 | SYSCTL_USE_PLL |
								SYSCTL_OSC_MAIN | SYSCTL_XTAL_8MHZ);
	Controller_Init();
  RIT128x96x4Init(1000000);
	RIT128x96x4Clear();
	SysTick_Init(0);
	Sound_Init();
	ADC_Init(2);
	init_actors();
	fire_func = &fire1;
	//playWAV((unsigned char *)&shoot[0], 4080, 1);
	
	buffer_draw(0,0, &title_2[0]);
	buffer_draw(52, 45, &start_ship1[0]);
	RIT128x96x4_Buffer();
	while (!get_buttons())
	{
		SysTick_Wait(300);
		buffer_draw(0,0, &title_1[0]);
		buffer_draw(52, 45, &start_ship1[0]);
		RIT128x96x4_Buffer();
		SysTick_Wait(300);
		if (get_buttons()) break;
		buffer_draw(0,0, &title_2[0]);
		buffer_draw(52, 45, &start_ship1[0]);
		RIT128x96x4_Buffer();
		random_init(NVIC_ST_CURRENT_R);
	}
	
	SysTick_Wait(300);
	buffer_draw(0,0, &title_2[0]);
	buffer_draw(56, 62, &start_ship2[0]);
	RIT128x96x4_Buffer();
	
	SysTick_Wait(300);
	buffer_draw(0,0, &title_1[0]);
	buffer_draw(60, 75, &start_ship3[0]);
	RIT128x96x4_Buffer();
	
	SysTick_Wait(300);
	//SysTick_Init(3750000);
	//SysTick_Init(25000000);
	SysTick_Init(2000000);
	
	
	while(1)
	{
	}
		//WaitForInterrupt();
}

void fire1(unsigned short x, unsigned short y, unsigned short tm4)
{
	if (tm4 == 0) addbullet(0x01, x-4, y-2, 0);
	if (tm4 == 2) addbullet(0x01, x+4, y-2, 0);
}

void fire2(unsigned short x, unsigned short y, unsigned short tm4)
{
	if (tm4 == 0) addbullet(0x05, x, y-4, 0);
	if (tm4 == 1) addbullet(0x01, x, y-4, 0);
	if (tm4 == 2) addbullet(0x09, x, y-4, 0);
}

void fire3(unsigned short x, unsigned short y, unsigned short tm4)
{
	if (tm4 == 0) addbullet(0x01, x-3, y-2, 0);
	if (tm4 == 1) addbullet(0x01, x-1, y-3, 0);
	if (tm4 == 2) addbullet(0x01, x+1, y-3, 0);
	if (tm4 == 3) addbullet(0x01, x+3, y-2, 0);
}

void SysTick_Handler(void)
{
	int i, sum = 0;
  for(i=0; i<N; i++)        // take N samples and perform the average
		sum = sum+ADC_In();      // sample 10-bit channel 2
	Data = sum/N;	           // noise reducing filter
	
	fire_func = &fire3;
	if (Data > 1024/3) fire_func = &fire2;
	if (Data > 2048/3) fire_func = &fire1;
	GPIO_PORTG_DATA_R ^= 0x04;
	update_actors(get_buttons());
	if (!(tick % MAX_FREQ) && !(random_int() % (log2(Data) + 1)))
	{
		addenemy((random_int() % (log2(score) + 1))/4 + (random_int() & 2));
	}
	//GPIO_PORTG_DATA_R ^= 0x04;
}

